import React from 'react';
import './MyFridge.css';

function MyFridge({ handleMyFridge }) {
  return (
    <div >
      <h2>MyFridge</h2>
      <label for="food">

        <input name="myInput" />
      </label>

      <button onClick={handleMyFridge}>Add Ingredients to MyFridge</button>
    </div>
  );
}

export default MyFridge;
